def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.convert_dtypes(infer_objects=False)

    agg_blocks: List[Block] = []
    indexer = []

    for block in data.blocks:
        locs = block.mgr_locs
        result = block._groupby_and_aggregate(how, numeric_only, min_count, self.grouper, alt)

        if result.is_list_like:
            for res, loc in zip(result, locs):
                agg_blocks.append(res)
                indexer.extend([loc] * res.shape[1])
        else:
            agg_blocks.append(result)
            indexer.extend([locs] * result.shape[1])

    return agg_blocks, parent_axis.labels.take(indexer)
